import { Link } from "react-router-dom";
import React, { useState, useEffect } from 'react';

function RealTimeCountdown() {
  const [timeLeft, setTimeLeft] = useState(getTimeLeft());

  useEffect(() => {
    const intervalId = setInterval(() => {
      setTimeLeft(getTimeLeft());
    }, 1000);
    return () => clearInterval(intervalId);
  }, []);

  function getTimeLeft() {
    const startDate = new Date('January 19, 2004');
    const now = new Date();
    const diff = now.getTime() - startDate.getTime();
    const days = Math.floor(diff / (1000 * 60 * 60 * 24));
    const hours = Math.floor((diff % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));
    const minutes = Math.floor((diff % (1000 * 60 * 60)) / (1000 * 60));
    const seconds = Math.floor((diff % (1000 * 60)) / 1000);
    return { days, hours, minutes, seconds };
  }

  return (
    <div>
      <p>Time elapsed since January 19th, 2004:</p>
      <p>{timeLeft.days} days {timeLeft.hours} hours {timeLeft.minutes} minutes {timeLeft.seconds} seconds</p>
    </div>
  );
}





const Profile = () => {
    return(
        <>
            <div className="bg-mybgcolor w-screen h-screen flex items-center justify-center">
                <div className="bg-mycolor w-4/5 h-4/5 relative flex rounded-lg shadow-xl">
                    <div className="border-4 w-full  m-5">
                        <div className="border-4 mx-auto mt-10 w-max font-bold text-4xl text-white">
                            PROFILE
                        </div>
                        <div className="border-4 mx-4 mt-20 text-center text-white font-thin">
                            My nickname is Dandy,  
                        </div>
                        <div className="flex items-center justify-center">
                            <div className="inline-flex gap-5 mt-40" role="group">
                                <Link className="rounded-lg px-6 py-2.5 bg-mybgcolor text-white font-medium text-xs uppercase hover:bg-mycolor2 focus:bg-blue-700 focus:outline-none focus:ring-0 active:bg-blue-800 transition duration-150 ease-in-out" to="/">Portfolio</Link> 
                                <Link className="rounded-lg px-6 py-2.5 bg-mybgcolor text-white font-medium text-xs uppercase hover:bg-mycolor2 focus:bg-blue-700 focus:outline-none focus:ring-0 active:bg-blue-800 transition duration-150 ease-in-out" to="profile">Profile</Link>
                                <Link className="rounded-lg px-6 py-2.5 bg-mybgcolor text-white font-medium text-xs uppercase hover:bg-mycolor2 focus:bg-blue-700 focus:outline-none focus:ring-0 active:bg-blue-800 transition duration-150 ease-in-out" to="education">Education</Link>
                                <Link className="rounded-lg px-6 py-2.5 bg-mybgcolor text-white font-medium text-xs uppercase hover:bg-mycolor2 focus:bg-blue-700 focus:outline-none focus:ring-0 active:bg-blue-800 transition duration-150 ease-in-out" to="contact">Contact</Link>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Profile;
